package Algorithm.LeetCode.leetcode.editor.cn;//给你一个字符串 s 、一个字符串 t 。返回 s 中涵盖 t 所有字符的最小子串。如果 s 中不存在涵盖 t 所有字符的子串，则返回空字符串 "" 。
//
// 
//
// 注意： 
//
// 
// 对于 t 中重复字符，我们寻找的子字符串中该字符数量必须不少于 t 中该字符数量。 
// 如果 s 中存在这样的子串，我们保证它是唯一的答案。 
// 
//
// 
//
// 示例 1： 
//
// 
//输入：s = "ADOBECODEBANC", t = "ABC"
//输出："BANC"
// 
//
// 示例 2： 
//
// 
//输入：s = "a", t = "a"
//输出："a"
// 
//
// 示例 3: 
//
// 
//输入: s = "a", t = "aa"
//输出: ""
//解释: t 中两个字符 'a' 均应包含在 s 的子串中，
//因此没有符合条件的子字符串，返回空字符串。 
//
// 
//
// 提示： 
//
// 
// 1 <= s.length, t.length <= 10⁵ 
// s 和 t 由英文字母组成 
// 
//
// 
//进阶：你能设计一个在 
//o(n) 时间内解决此问题的算法吗？
//
// Related Topics 哈希表 字符串 滑动窗口 👍 2225 👎 0


import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

//leetcode submit region begin(Prohibit modification and deletion)
class Solution {
    public static void main(String[] args) {
        System.out.println(new Solution().minWindow("", ""));
    }


    /**
     * 滑动窗口
     * 思路：1.首先通过 t 确定每个字符的出现频率，并存储到 need 哈希表中。window表示滑动窗口包含 need 中对应字
     *        符在窗口中的个数，确定两个指针 left、right，分别表示包含滑动窗口的左右边界。
     *      2.窗口向右扩大，直到包含了所有 need 中有的字符并且对应字符个数大于等于need中的个数，说明找到了1个解法
     *      3.左边界向右移动，缩小窗口，试图找到最优解。如果左边界向右移动过程中，剔除了need对应的字符，且窗口中对应字符的
     *        个数不满足要求，停止缩小窗口。
     *      4.再重复2-3，直至到达 s 的末尾。
     * 复杂度：
     * @param s
     * @param t
     * @return
     */
    public String minWindow(String s, String t) {
        Map<Character, Integer> need = new HashMap<>();
        Map<Character, Integer> window = new HashMap<>();
        int slen = s.length();
        int tlen = t.length();
        // 确定每个字符的出现频率，并存储到 need 哈希表中
        for(int i = 0; i < tlen; i++){
            need.put(t.charAt(i), need.getOrDefault(t.charAt(i), 0) + 1);
        }
        // 窗口左右边界
        int left = 0, right = 0;
        // 结果字符串开始位置，长度
        int start = 0, len = Integer.MAX_VALUE;
        // 匹配个数
        int matchCount = 0;
        while(right < slen){
            // 窗口向右扩大，直到包含了所有 need 中有的字符并且对应字符个数大于等于need中的个数
            char c1 = s.charAt(right);
            right++;
            if(need.containsKey(c1)){
                window.put(c1, window.getOrDefault(c1, 0) + 1);
                if(window.get(c1).equals(need.get(c1))){
                    matchCount++;
                }
            }
            // 找到了1个解法，左边界向右移动，缩小窗口，试图找到最优解
            while(matchCount == need.size()){
                // 存储最优解
                if(right - left < len){
                    len = right - left;
                    start = left;
                }
                char c2 = s.charAt(left);
                left++;
                if(need.containsKey(c2)){
                    if(window.get(c2).equals(need.get(c2))){
                        matchCount--;
                    }
                    window.put(c2, window.get(c2) - 1);
                }
            }
        }
        return len == Integer.MAX_VALUE ? "" : s.substring(start, start + len);
    }
}
